<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Certificate Donatur</title>

        <style>
        /* Font Faces - Tetap gunakan public_path() dan berikan format fallback jika ada TTF/OTF */
        @font-face {
            font-family: 'Passion One';
            src: url('{{ public_path('asset/assets/sertif/Passion_One/PassionOne-Regular.ttf') }}') format('truetype'),

            /* Coba tambahkan TTF/OTF sebagai fallback jika WOFF/ttf bermasalah */
            /* src: url('{{ public_path('asset/assets/sertif/Passion_One/PassionOne-Regular.ttf') }}') format('truetype'); */
            font-weight: normal;
            font-style: normal;
            font-display: swap;
        }

        @font-face {
            font-family: 'Passion One';
            src: url('{{ public_path('asset/assets/sertif/Passion_One/PassionOne-Bold.ttf') }}') format('truetype'),
            /* src: url('{{ public_path('asset/assets/sertif/Passion_One/PassionOne-Bold.ttf') }}') format('truetype'); */
            font-weight: bold;
            font-style: normal;
            font-display: swap;
        }

        @font-face {
            font-family: 'Passion One';
            src: url('{{ public_path('asset/assets/sertif/Passion_One/PassionOne-Black.ttf') }}') format('truetype');
            font-weight: 900;
            font-style: normal;
            font-display: swap;
        }

        @font-face {
            font-family: 'Great Vibes';
            src: url('{{ public_path('asset/assets/sertif/great-vibes-font/GreatVibes-Regular.ttf') }}') format('truetype');
            font-weight: normal;
            font-style: normal;
            font-display: swap;
        }

        body{
            background-color: #ffffff;
            margin: 0;
            padding: 0;
        }

        .container {
            position: relative;
            background-color: #29642A;
            width: 1000px;
            height: 700px;
            
            box-shadow: 0px 10px 15px -3px rgba(0, 0, 0, 0.1), 0px 4px 6px -2px rgba(0, 0, 0, 0.05);
            padding: 40px;
            box-sizing: border-box;
        }

        .kiriatas {
            position: absolute;
            top: -100px;
            left: -80px;
            width: 398px;
            height: auto;
        }

        .kananatas {
            position: absolute;
            top: -5%; /* Ini masih % - sebaiknya ubah ke PX jika ingin konsisten */
            right: 0;
            height: auto;
            width: 398px;
        }

        .kananbawah {
            position: absolute;
            bottom: -13%; /* Ini masih % - sebaiknya ubah ke PX jika ingin konsisten */
            right: -11%; /* Ini masih % - sebaiknya ubah ke PX jika ingin konsisten */
            height: auto;
            width: 398px;
            transform: rotate(180deg);
        }

        .kiribawah {
            position: absolute;
            bottom: -3%; /* Ini masih % - sebaiknya ubah ke PX jika ingin konsisten */
            left: 0;
            height: auto;
            width: 398px;
            transform: rotate(180deg);
        }

        .main {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: space-between;
            padding-left: 120px;
            padding-right: 120px; 
            padding-top: 16px;
            padding-bottom: 16px;
            text-align: center;
            z-index: 10;
            box-sizing: border-box;
        }

        .containerlogo {
            margin-top: 0px;
        }

        .logo {
            text-align: center;
        }

        .logo img {
            max-width: 200px;
            height: auto;
        }

        .title {
            font-size: 64px;
            font-family: "Passion One", cursive;
            font-weight: 700;
            color: #FFF0B7;
            text-transform: uppercase;
            margin-top: 32px;
            letter-spacing: 0.05em;
        }

        .proudly {
            font-size: 20px;
            font-family: "Montserrat", sans-serif; /* Pastikan font Montserrat juga didefinisikan via @font-face jika digunakan */
            font-weight: 400;
            color: #F6F6F6;
            text-transform: uppercase;
            letter-spacing: 0.05em;
        }

        .name {
            font-size: 48px;
            font-family: "Great Vibes", cursive;
            font-weight: 400;
            color: #FFF0B7;
            margin-top: 48px;
            text-transform: capitalize;
            letter-spacing: 0.05em;
            margin-bottom: 0px;
        }

        .desc {
            font-size: 16px;
            color: #F6F6F6;
            margin-bottom: 96px;
            text-transform: uppercase;
            padding-left: 192px;
            padding-right: 192px;
            margin-top: 24px;
        }

        .role {
            font-style: italic;
            font-weight: 700;
            text-transform: uppercase;
        }

        .event {
            font-weight: 700;
        }

        .line {
            position: absolute;
            height: auto;
            width: 100%;
            max-width: 100%;
            left: 0;
            right: 0;
            z-index: 0;
            top: 200px;
        }

        .containerttd {
            display: flex;
            flex-direction: row;
            justify-content: space-between;
            width: 100%;
            padding-left: 200px;
            padding-right: 200px;
            z-index: 10;
        }

        .partner {
            display: block;
            margin-top: 64px;
            text-align: left;
        }

        .partner-name {
            text-transform: uppercase;
            font-weight: 700;
            color: #FFF0B7;
            font-size: 12px;
            font-family: "Passion One", cursive;
        }

        .partner-type {
            text-transform: uppercase;
            color: #F6F6F6;
            font-size: 12px;
            font-family: "Montserrat", sans-serif;
        }

        .advisor {
            display: block;
            text-align: center;
        }

        .advisor-name {
            text-transform: uppercase;
            font-weight: 700;
            color: #FFF0B7;
            font-size: 12px;
            font-family: "Passion One", cursive;
            margin-top: 16px;
        }

        .advisor-hh {
            text-transform: uppercase;
            color: #F6F6F6;
            font-size: 12px;
            font-family: "Montserrat", sans-serif;
        }
    </style>
</head>
